import { useNavigate } from "react-router-dom";

let Home = () => {
  const navigate = useNavigate()

  return (
        <div>
          This is the homepage
          <div typeof="inline">
            <button onClick={() => navigate('Question_1')}></button>
          </div>
        </div>
  )
};

export default Home;
